require.config({"config": {
        "text":{"Magento_Msrp/template/product/item/popup.html":"<!--\n/**\n * Copyright \u00a9 2017 Magento. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"map-popup\"\n     data-role=\"msrp-popup\">\n    <div class=\"map-info-price\">\n        <div class=\"price-box\">\n            <div class=\"map-msrp\">\n                <span class=\"label\"\n                      translate=\"'Price'\"/>\n\n                <span class=\"old-price map-old-price\">\n                    <span class=\"price-container price-msrp\">\n                        <span class=\"price-wrapper\"\n                              html=\"getPrice($row())['msrp_price']\"/>\n                    </span>\n                </span>\n            </div>\n\n            <div class=\"map-price\">\n                <span class=\"label\"\n                      translate=\"'Actual Price'\"/>\n\n                <span class=\"actual-price\">\n                    <if args=\"isAllowed()\">\n                        <each args=\"data: getPrices($row()), as: '$price'\">\n                            <with args=\"$price\">\n                                <render args=\"getBody()\"/>\n                            </with>\n                        </each>\n                    </if>\n                </span>\n            </div>\n        </div>\n\n        <div class=\"map-form-addtocart\">\n            <with args=\"$parent.getComponentByCode('addtocart-button')\">\n                <render args=\"getBody()\" />\n            </with>\n        </div>\n    </div>\n\n    <div class=\"map-text\"\n         html=\"getExplanationMessage($row())\"/>\n</div>\n"}
}});
